Dani Daniels and her boyfriend sneak into a random house to have sex in order to spice up their love life. Little did they know that the homeowner, Nicole Aniston, is home and catches them in the act. Nicole is ready to call the police on them but Dani begs for her not to. Nicole is willing to let their trespassing slide as long as she can get in on the action with them. Dani and her boyfriend happily comply
